@notice Allows users to add liquidity to the pool in exchange for LP tokens. Taxed tokens are not supported.
The recipient will receive the minted LP tokens.
@param recipient The address that will receive the minted LP tokens.

@notice Allows users to redeem their LP tokens for underlying assets.
The recipient will receive the redeemed tokens.
@param recipient The address that will receive the redeemed tokens.
@return thisOut The amount of thisToken redeemed.
@return thatOut The amount of thatToken redeemed.

@notice Allows the caller to transfer excess thisToken or thatToken to a specified recipient.
The recipient will receive the excess tokens.
@param token The address of the token (thisToken or thatToken) to be transferred.
@param recipient The address that will receive the excess tokens.

@notice Recovers tokens mistakenly sent to the Pool contract and sends them to the specified recipient.
@param token The address of the token to recover.
@param recipient The address of the recipient to receive the recovered tokens.
@dev Can only be called by the owner. Tokens specified as thisToken or thatToken cannot be recovered.

@notice Allows users to swap tokens in the pool.
The recipient will receive the swapped tokens.
@param recipient The address that will receive the swapped tokens.
